//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.0;

import "hardhat/console.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@gnosis.pm/zodiac/contracts/core/Module.sol";

contract BrentModule is Module {
    string private safeAddress;

    address private tokenAddress;
    string private tokenId;
    address lenderAddress;

    constructor(address _tokenAddress, address _lenderAddress, string memory _tokenId) {
      bytes memory initializeParams = abi.encode(_tokenAddress, _tokenId, _lenderAddress);
      setUp(initializeParams);

      tokenAddress = _tokenAddress;
      lenderAddress = _lenderAddress;
      tokenId = _tokenId;
    }

    function setUp(bytes memory initializeParams) public virtual override {
      (address _tokenAddress, string memory _tokenId, address _lenderAddress) = abi.decode(initializeParams, (address, string, address));

      tokenAddress = _tokenAddress;
      lenderAddress = _lenderAddress;
      tokenId = _tokenId;
    }


    function returnNFT(bytes memory data) public returns (bool success) {
        require(msg.sender == lenderAddress);

        // ERC721 token = ERC721(tokenAddress);
        // const data = token.safeTransferFrom(address(target), lenderAddress, tokenId)

        success = IAvatar(target).execTransactionFromModule(
            lenderAddress,
            0,
            data,
            Enum.Operation.Call
        );
        return success;
    }
  }

